import { v4 as uuidv4 } from 'uuid';
import axios from 'axios'

const BASE_URL = 'http://localhost:5001'

class Square {

    static async createPayments() {
        try {
            const response = await axios.post(`${BASE_URL}/square/payments`)
            return response
            } catch(error) {
            console.log(error);
        }
}
}

export default Square
